measurements.description:
Three flowers and four buds on one 64-cm upright unsupported inflorescence;
dorsal sepal recurved, light chartreuse, darker centrally and basally, darker veins;
synsepal ovate-epiculate, recurved centrally, cream, striped light green;
 petals spatulate, pale chartreuse, lighter distally;
 pouch light chartreuse;
 staminode light chartreuse, darker centrally;
 substance medium; texture matte, pouch waxy.
